import {createBrowserRouter} from "react-router-dom";
import Home from "../Pages/Home";
import Login from "../Pages/Login";
import Categories from "../Pages/Categories";

const router = createBrowserRouter([
  {
    path:"/",
    element: <Home/>
  },
  {
    path:'/login',
    element: <Login/>
  },
  {
    path:'/categories/:id',
    element:''
  },
  {
    path:'/categories',
    element:<Categories/>
  }
])
export default router
